INSERT INTO `meta_generators` VALUES (1,'Filter','filter','$name$ $attributes${ супер распродажа $discount$} - огромный каталог','Купить $vinpad$$attributes${ - [тотальная|большая|гигантская|глобальная|огромная|массовая|грандиозная|колоссальная] распродажа $discount$[интернет-магазина|магазина|на сайте|официального сайта]}. [Самые выгодные|Выгодные|Самые лучшие|Лучшие|Самые низкие|Низкие|Самые привлекательные|Привлекательные|Самые заманчивые|Заманчивые|Самые доступные|Доступные|Самые оптимальные|Оптимальные|Самые сладкие|Сладкие] цены на всё! [Гигантский|Огромный|Большой] каталог. Доставка [- Москва и Россия|по Москве и России|как по Москве, так и по России|и в Москву и в регионы|в любой город|в любую точку мира].','$name$ $attributes$ { - распродажа $discount$}','<strong>$name$ $attributes${ по распродаже $discount$}</strong>{[ со скидками| со скидкой| - скидки| с дисконтом] до $discountMax$%}. [В каталоге|На сайте|В нашем магазине|В нашем интернет-магазине] [в наличии|представлено|присутствует|доступно для заказа] $count$ по цене от $priceMin$ руб. $vinpad$ {<strong>с дисконтом</strong> $discount$} [можно|есть возможность|возможно] <strong>купить [с доставкой|и доставить]</strong> по Москве, либо [по России|отправить в другой город|отправить по России|отправить в регионы|отправить в любую точку мира].','<p><strong>Купить $vinpad$</strong> с выбранными параметрами <strong>\"$attributes${ по распродаже $discount$}\"</strong> можно с доставкой [как по Москве, так и по России|и по Москве и по России|и в пределах Москвы, и отправить посылкой по России|в любой город - будь то Москва или другой город России]. Наш [интернет-магазин|магазин|сайт|официальный сайт]  [предлагает|представляет] [гигантский выбор|гигантский ассортимент|большой выбор|большой ассортимент|гигантскую коллекцию|большую коллекцию|гигантскую подборку|большую подборку] товаров в разделе \"$name$\". [Кроме того|Более того|Кроме всего прочего|Плюс ко всему|Помимо этого], <strong>в каталоге [представлено|находится|в наличии|доступны для заказа] $count$</strong> по цене от $priceMin$ до $priceMax$ руб. {[Нельзя не|Стоит|Хотелось бы|Следует|Нужно|Необходимо|Надо] [отметить|заметить|упомянуть|добавить|подчеркнуть|сказать], что [сегодня|на сегодняшний день|на данный момент|прямо сейчас|в настоящий момент] действуют <strong>скидки до $discountMax$%</strong>.}</p>\r\n<p>В <strong>{распродажном $discount$}интернет-каталоге</strong> Вы, [несомненно,|определенно,|совершенно точно,|разумеется,] [найдете|сможете найти|сможете выбрать] $vinpad$, так как мы [подобрали|сделали подборку|собрали воедино] $count$ со всех [популярных|известных|проверенных|распространенных|доступных] [интернет-магазинов|сайтов|каталогов|магазинов]. Сравнивайте [предложения|ассортимент] и [совершайте|делайте|осуществляйте] покупки. И будьте уверенны, что <strong>$name$ $attributes$</strong> достанется Вам по [разумным|самым разумным|выгодным|самым выгодным|наиболее выгодным|наиболее разумным||экономным|наиболее экономным|привлекательным|наиболее привлекательным|сладким|самым сладким|наиболее сладким] ценам!</p>'),(2,'Category','category','$name$ - огромный каталог','Купить $vinpad$ по [самым выгодным|выгодным|самым лучшим|лучшим|самым низким|низким|самым привлекательным|привлекательным|самым заманчивым|заманчивым|самым доступным|доступным|самым оптимальным|оптимальным] ценам. [Гигантский выбор|Гигантский ассортимент|Большой выбор|Большой ассортимент|Гигантская коллекция|Большая коллекция|Гигантская подборка|Большая подборка] в каталоге нашего [сайта|интернет-магазина|магазина]. Доставка по Москве и России.','$name$','<strong>$name$</strong> по [самой выгодной|выгодной|самой лучшей|лучшей|самой низкой|низкой|самой привлекательной/привлекательной|самой заманчивой|заманчивой|самой доступной|доступной|самой оптимальной|оптимальной] цене {со скидками до $discountMax$%}. Можно <strong>купить с доставкой</strong> до [дома|квартиры|дверей]. В <strong>каталоге [на сайте|интернет-магазина|магазина|нашего сайта]</strong> $count$ от $priceMin$ руб.','<p>Купить $vinpad$ по [лучшим|самым низким|низким|самым привлекательным|привлекательным|самым заманчивым|заманчивым|самым доступным|доступным|самым оптимальным|оптимальным|самым выгодным|выгодным|самым лучшим] ценам. [Гигантский выбор|Гигантский ассортимент|Большой выбор|Большой ассортимент|Гигантская коллекция|Большая коллекция|Гигантская подборка|Большая подборка] в каталоге нашего [сайта|интернет-магазина|магазина] насчитывает $count$ разных [фирм|производителей|брендов] от $priceMin$ до $priceMax$ руб. [Помимо этого|Кроме того|Более того|Кроме всего прочего|Плюс ко всему], Вы можете [купить|приобрести|заказать|оформить] [любой|тот или иной] товар как с доставкой, так и [забрать в магазине|самовывозом]. У нас [быстрая|ускоренная|моментальная|мгновенная] доставка не только по Москве, но и по России.</p>\r\n<p>Самый [большой|огромный|гигантский|внушительный|широкий] выбор в разделе \"$name$\" среди всех интернет-[магазинов|сайтов|каталогов]! А также подробное описание, отзывы и рейтинги.</p>'),(3,'Product','product',NULL,NULL,NULL,NULL,NULL);
